import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/images/logo_header.jpg';
import karol from '../assets/images/karol.jpeg';

const Header = () => {
  return (
    <header className="header">
      <div id="header_logo">
        <div id="l_header_logo">
          <Link to="/">
            <img src={logo} alt="logo" className="logo" style={{ width: '70%', borderRadius: '30px' }} />
          </Link>
        </div>
        <div className="center_header" id="c_header_logo">
          <Link to="/user-panel" className="link_but_button">Zakłady</Link>
          <Link to="/live" className="link_but_button">Na Żywo</Link>
          <Link to="/spin" className="link_but_button">
            <img src={karol} alt="spin" className="logo" style={{ width: '150px', borderRadius: '50px' }} />
          </Link>
        </div>
        <div id="r_header_logo">
          <Link to="/login" className="link_but_button">Zaloguj się</Link>
          <Link to="/register" className="link_but_button">Zarejestruj się</Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
